import React from 'react';
import "./header.css";

const header = () => {
    return (
        <header>
            <nav className="nav container">
                <a href="index.html" className="nav__logo">Vibhuti</a>
                <div className="nav__menu">
                    <ul className="nav__list grid"></ul>
                </div>
            </nav>
        </header>
    )
}

export default header
